import React from "react";
import { connect } from "react-redux";
import { getAnalitikList } from "../Action/BarangAction";

const mapStateToProps = function (state) {
  return {
    getAnalitikList: state.barangInventory.getAnalitikList,
    errorAnalitikList: state.barangInventory.errorAnalitikList,
  };
};

// const DataAnalitikDetail = {
//   logical_uid: "logical_uid",
//   status: "status",
//   qty: "qty",
//   time: "time",
// };

let data_analitik_list = [];
getAnalitikList.logical_uid.forEach(item, (index) => {
  data_analitik_list.push(<li key={index}>{item}</li>);
});

const DataAnalitikComponent = (props) => {
  return (
    <div>
      <h1>{props.getAnalitikList.logical_uid}</h1>
    </div>
  );
};

export default connect(mapStateToProps, null)(DataAnalitikComponent);
